import React from "react";
import "./Projects.css";

function Projects() {
  return (
    <div className="projectsContainer" id="">
      <img
        className="projectsPicture"
        src="https://images.unsplash.com/photo-1531403009284-440f080d1e12?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=2070&q=80"
        alt="projects"
      />
      <p className="projectsText">
        projects <br />
        <br />I do projects. <br />
        <br />
        Me projects impressive. <br />
        <br />
        Even work sometimes.{" "}
      </p>
    </div>
  );
}

export default Projects;
